import React, { Component } from 'react';

export class Home extends Component {
      render() {
        return(
          <div>
          <video autoPlay loop
        style={{
          objectFit: 'cover',
          width: '100%',
          height: '100%',
        }}
        src="https://res.cloudinary.com/dlyhbsnfb/video/upload/v1564364034/milky-way/milky_way_dlopql.mp4"
      />
          </div>
        )
      }
}
